import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import Registracija from './Registracija';
import Logovanje from './Logovanje';

const App=()=>{
  return (
    <BrowserRouter>
    <div>
      <h1>Dobro dosli na nasu stranicu!</h1>
      <Registracija/>
      <Logovanje/>
    </div>
    </BrowserRouter>
  );
};

export default App;
